import React from "react";
import "../stylesheets/Club.scss";

const Club = (props) => {
  return (
    <li className="list__item">
      <i className={`icon ${props.eachClub.fa}`} />
      <div>
        <h2 className="item__title">{props.eachClub.name}</h2>
        <ul className="item__members">
          <h3>Members:</h3>
          <li>{props.eachClub.members.join(" , ")} </li>
        </ul>
      </div>
    </li>
  );
};

export default Club;
